import React from 'react'
import {
	FormikWizardProvider,
	Wizard,
	StepsList,
	Step,
	ButtonsList,
	PreviousButton,
	NextButton,
	SubmitButton
} from  "formik-wizard-form";
import SignUpForm2 from './SignUpForm2.js'
import PaymentInfo from './PaymentInfo.js'
import AppsYouHave from './AppsYouHave.js'

const UserForm = (props) => (
	<FormikWizardProvider {...props}>
		{(renderProps) => (
			<Wizard {...renderProps}>
				<StepsList>
					<Step component={SignUpForm2} title="SignUpForm2" />
					<Step component={PaymentInfo} title="Contact Details" />
					<Step component={AppsYouHave} title="Address Details" />
				</StepsList>
				<ButtonsList>
					<PreviousButton />
					<NextButton />
					<SubmitButton />
				</ButtonsList>
			</Wizard>
		)}
	</FormikWizardProvider>
)

// Finally wrap this form in withFormik higher order component given by formik
const Test = ({ signUp, loading, error, cleanUp }) => {
    console.log(error) // remove this when you get error to show
    useEffect(() => {
        return () => {
            cleanUp()
        }
    }, [cleanUp])

    return(
        withFormik({
            mapPropsToValues: () => ({
                firstName: "",
                lastName: "",
                username: "",
                email: "",
                phone: "",
                passwordOne: "",
                passwordTwo: '',
            }),
            handleSubmit: async ( values, { resetForm, setSubmitting }) => {
                await signUp(values)
                resetForm()
                setSubmitting(false)
                console.log("Submitted")
            }
        })(UserForm))
}

const mapStateToProps = ({ auth }) => ({
    loading: auth.loading,
    error: auth.error,
})

const mapDispatchToProps = {
    signUp: actions.signUp,
    cleanUp: actions.clean,
}

connect(mapStateToProps, mapDispatchToProps)(Test)

export default Test
